-- Lisätään Ii:n urakalle testiksi muutamia talvihoitoreittejä
DO
$$
    DECLARE
        urakka_id    INTEGER;
        luoja_id     INTEGER;
        reitti1_id   INTEGER;
        reitti2_id   INTEGER;
        sijainti1_id INTEGER;
        sijainti2_id INTEGER;
        sijainti3_id INTEGER;

    BEGIN

        SELECT id INTO luoja_id FROM kayttaja WHERE kayttajanimi = 'Integraatio';
        SELECT id INTO urakka_id FROM urakka WHERE nimi = 'Iin MHU 2021-2026';

        INSERT INTO talvihoitoreitti (nimi, urakka_id, ulkoinen_id, varikoodi, muokattu, muokkaaja, luotu, luoja)
        VALUES ('Reitti 1', urakka_id, 'Reitti 1', '#FF8D1A',NULL, NULL, NOW(), luoja_id);
        INSERT INTO talvihoitoreitti (nimi, urakka_id, ulkoinen_id, varikoodi, muokattu, muokkaaja, luotu, luoja)
        VALUES ('Reitti 2', urakka_id, 'Reitti 2', '#FF8D1A',NULL, NULL, NOW(), luoja_id);

        -- Haetaan reittien id:t lisäämisen jälkeen
        SELECT id INTO reitti1_id FROM talvihoitoreitti WHERE nimi = 'Reitti 1';
        SELECT id INTO reitti2_id FROM talvihoitoreitti WHERE nimi = 'Reitti 2';

        -- Lisätään reiteille sijannit
        INSERT INTO talvihoitoreitti_sijainti (talvihoitoreitti_id, tie, alkuosa, alkuetaisyys, loppuosa,
                                               loppuetaisyys, hoitoluokka, pituus_m, reitti)
        VALUES (reitti1_id, 4, 414, 1, 420, 1000, 'Is', 54.00,
                '');

        INSERT INTO talvihoitoreitti_sijainti (talvihoitoreitti_id, tie, alkuosa, alkuetaisyys, loppuosa,
                                               loppuetaisyys, hoitoluokka, pituus_m, reitti)
        VALUES (reitti1_id, 4, 404, 1, 408, 1000, 'Ib', 10.00,
                '');

        INSERT INTO talvihoitoreitti_sijainti (talvihoitoreitti_id, tie, alkuosa, alkuetaisyys, loppuosa,
                                               loppuetaisyys, hoitoluokka, pituus_m, reitti)
        VALUES (reitti2_id, 4, 408, 1, 410, 1000, 'Ise', 4.00,
                '');


        -- Haetaan sijaintien id:t lisäämisen jälkeen
        SELECT id
          INTO sijainti1_id
          FROM talvihoitoreitti_sijainti
         WHERE talvihoitoreitti_id = reitti1_id
           AND tie = 4
           AND alkuosa = 414
           AND alkuetaisyys = 1;

        SELECT id
          INTO sijainti2_id
          FROM talvihoitoreitti_sijainti
         WHERE talvihoitoreitti_id = reitti1_id
           AND tie = 4
           AND alkuosa = 404
           AND alkuetaisyys = 1;
        SELECT id
          INTO sijainti3_id
          FROM talvihoitoreitti_sijainti
         WHERE talvihoitoreitti_id = reitti2_id
           AND tie = 4
           AND alkuosa = 408
           AND alkuetaisyys = 1;

        -- Lisätään kalustot sijainneille
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti1_id, 'TR', 2);
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti1_id, 'KA', 1);
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti2_id, 'TR', 1);
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti2_id, 'KA', 2);
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti3_id, 'KA', 1);
        INSERT INTO talvihoitoreitti_sijainti_kalusto (talvihoitoreitti_sijainti_id, kalustotyyppi, maara)
        VALUES (sijainti3_id, 'KUP', 1);

    END;
$$ LANGUAGE plpgsql;
